class TreeNode {
  constructor(value) {
    this.value = value;
    this.left = null;
    this.right = null;
  }
};

class BinaryTree {
  constructor (){
    this.root = null;
  }

  insert(value){
    let newNode = new TreeNode(value);
    if(!this.root){
      console.log("i am here");
      this.root = newNode;
      return newNode;
    }
    let current = this.root;
    while(true){
      if(current.value > value){
        if(!current.left){
          current.left = newNode;
          return;
        }
        current = current.left;
      }else{
        if(!current.right){
          current.right = newNode;
        }
        current = current.right;
        return;
      }
    }
  }
}

